/**
 * Logo MaxNutrition em Base64
 * 
 * Este arquivo contém o logo oficial da MaxNutrition codificado em base64
 * para uso em PDFs e impressões onde imagens externas não carregam.
 * 
 * Uso: import { LOGO_DARK_BASE64 } from "@/lib/logo-base64";
 *      <img src={LOGO_DARK_BASE64} alt="MaxNutrition" />
 */

// Logo escuro (texto preto) - para fundos claros (impressão/PDF)
// Base64 completo do arquivo public/logo-dark.png (31KB JPEG)
export const LOGO_DARK_BASE64 = `data:image/jpeg;base64,
`;

// Função helper para obter o logo base64
export const getLogoBase64 = () => LOGO_DARK_BASE64;
